import './Table.css';

import  { useState,useEffect } from 'react';






function Table() {

  const [data, setData] = useState('');

  useEffect(()=>{

    var xhttp = new XMLHttpRequest();    
    xhttp.open("GET", "http://localhost:8080/api/getData");
    xhttp.send();
    xhttp.onload = function() {  
      if(this.status==200){
        let response=JSON.parse(this.responseText);
        setData(response);        
      }
    };


  },[]);


  function displayData(){
    if(data!=''){
      let d;
      for (d of data){
        return (
              <div className='row top1 full border'>
                <div className='col-auto'></div>
                <div className='col'><small>{d.data['Identification number']}</small></div>
                <div className='col'><small>{d.data['Name']}</small></div>
                <div className='col'><small>{d.data['Gender']}</small></div>
                <div className='col'><small>{d.data['Risk']}</small></div>
                <div className='col'><small>{d.data['Hair length']}</small></div>
                <div className='col-auto'><small>{d.data['IQ']}</small></div>
                <div className='col'><small>{d.data['Admission date']}</small></div>
                <div className='col'><small>{d.data['Last breakdown']}</small></div>
                <div className='col'><small>{d.data['Yearly fee']}</small></div>
                <div className='col'><small>{d.data['Knows the Joker?']}</small></div>
                <div className='col-auto'></div>
              </div>
        )
      }
    }
  }


    return (
      <div className='container border'>
          <div className='row'>Data-1 JSON </div>
          <div className='row top1 full record'>
              <div className='col-auto'></div>
              <div className='col-auto'><small>Identification number</small></div>
              <div className='col-auto'><small>Name</small></div>
              <div className='col-auto'><small>Gender</small></div>
              <div className='col-auto'><small>Risk</small></div>
              <div className='col-auto'><small>Hair length</small></div>
              <div className='col-auto'><small>IQ</small></div>
              <div className='col-auto'><small>Admission date</small></div>
              <div className='col-auto'><small>Last breakdown</small></div>
              <div className='col-auto'><small>Yearly fee</small></div>
              <div className='col-auto'><small>Knows the joker?</small></div>
              <div className='col-auto'></div>
          </div>
          {displayData()}
          {/* <div className='row top2 full border'> {displayData()}  </div> */}

      </div>
    );
  }

  export default Table;
